	public Map<String, String> generateItemOrderMapGCMP(String gcmp_data_v2_xml) {

		JSONObject gcmp_data_v2_json = XML.toJSONObject(gcmp_data_v2_xml, true);
		
//		System.out.println("gcmp_data_v2_json : " + gcmp_data_v2_json);
		JSONArray fulfillmentUnits = new JSONArray();
		
		if(!gcmp_data_v2_json.getJSONObject("soap:Envelope").getJSONObject("soap:Body").getJSONObject("GetOrderResponse").has("GetOrderResult")) {
			return null;
		}
		
		Object fulfillmentUnits_obj = gcmp_data_v2_json.getJSONObject("soap:Envelope").getJSONObject("soap:Body").getJSONObject("GetOrderResponse").getJSONObject("GetOrderResult")
		.getJSONObject("OrderForms")
		.getJSONObject("OrderForm").getJSONObject("FulfillmentUnits").get("FulfillmentUnit");
		
		if(fulfillmentUnits_obj instanceof JSONObject) {
			fulfillmentUnits.put(fulfillmentUnits_obj);
		} else if(fulfillmentUnits_obj instanceof JSONArray) {
			fulfillmentUnits = (JSONArray) fulfillmentUnits_obj;
		}
		
		Map<String,String> itemid_orderNum = new HashMap<String,String>();
		for(int j=0;j<fulfillmentUnits.length();j++) {
//			System.out.println(fulfillmentUnits.getJSONObject(j));
			String gcmp_data_v2_itemId = fulfillmentUnits.getJSONObject(j).getJSONObject("FulfillmentItemInformation")
			.getJSONObject("FulfillmentItemInformation").getString("ItemId");

			if(fulfillmentUnits.getJSONObject(j).get("BackendResponses") instanceof JSONObject) {

				
				String gcmp_data_v2_orderNum = fulfillmentUnits.getJSONObject(j).getJSONObject("BackendResponses")
				.getJSONObject("BackendResponse").getJSONObject("BackendOrders")
				.getJSONObject("BackendOrder").getString("OrderNum") ;
				
//				System.out.println("gcmp_data_v2_orderNum : " + gcmp_data_v2_orderNum);
//				System.out.println("gcmp_data_v2_itemId : " + gcmp_data_v2_itemId);
				
				itemid_orderNum.put(gcmp_data_v2_itemId, gcmp_data_v2_orderNum);
//				System.out.println("---------------------------------------------------------------");
			}
			else {
				System.out.println("JSONObject[\"BackendResponses\"] is not a JSONObject.");
			}
		}
		
		return itemid_orderNum;
	}
	
	
	
	public Map<String, String> generateItemOrderMapOMCS(String omcs_data_str) {
		JSONObject omcs_data_json = new JSONObject(omcs_data_str);
		
//		System.out.println("omcs_data_str : " + omcs_data_str );
		JSONArray fulfillmentUnits = omcs_data_json.getJSONObject("orderDomain").getJSONObject("fulfillmentUnitInfo")
		.getJSONArray("fulfillmentUnit");
		
//		System.out.println("FulfillmentUnit : " + fulfillmentUnits);
		
		Map<String,String> itemid_orderNum = new HashMap<String,String>();
		for(int j=0;j<fulfillmentUnits.length();j++) {
//			System.out.println(fulfillmentUnits.getJSONObject(j));
			JSONArray omcs_data_itemInfo = fulfillmentUnits.getJSONObject(j).getJSONArray("itemInfo");
			if(omcs_data_itemInfo.length() > 0) {
				String omcs_data_itemId = "";
				omcs_data_itemId = omcs_data_itemInfo.getJSONObject(0).getString("id");
				String omcs_data_orderNum = fulfillmentUnits.getJSONObject(j).getString("orderNumber") ;
//				System.out.println("omcs_data_orderNum : " + omcs_data_orderNum);
//				System.out.println("omcs_data_itemId : " + omcs_data_itemId);
				itemid_orderNum.put(omcs_data_itemId, omcs_data_orderNum);
//				System.out.println("---------------------------------------------------------------");
			}
		}
		return itemid_orderNum;
	}
	
	
	public JSONObject generateLineMap(JSONObject B2B_data_Obj, Map<String,String> itemid_orderNum) {
		JSONObject finalStructure = new JSONObject("{\r\n" + 
				"  \"DPID\": \"\",\r\n" + 
				"  \"_embedded\": {\r\n" + 
				"    \"lines\": {\r\n" + 
				"    }\r\n" + 
				"  },\r\n" + 
				"  \"PartnerCountry\": \"\",\r\n" + 
				"  \"Partner\": \"\",\r\n" + 
				"  \"PurchaseOrderNumber\": \"\"\r\n" + 
				"}");
		
		
		JSONArray b2b_LineItems = B2B_data_Obj.getJSONArray("LineItems");
		
		int countLine = 1;
		for(int i=0;i<b2b_LineItems.length();i++) {
			JSONObject oneLineItem = b2b_LineItems.getJSONObject(i);
			JSONObject oneLine = new JSONObject();
			JSONObject productInformation = new JSONObject();
			JSONObject orderInformation = new JSONObject();
			if(oneLineItem.has("VendorPartNumber")) {
				productInformation.put("VendorPartNumber", oneLineItem.getString("VendorPartNumber"));
			}
			if(oneLineItem.has("ItemDescription") && (!oneLineItem.isNull("ItemDescription"))) {
				productInformation.put("ItemDescription", oneLineItem.getString("ItemDescription"));
			}
			oneLine.put("ProductInformation", productInformation);
			if(oneLineItem.has("UnitPrice")) {
				oneLine.put("UnitPrice", oneLineItem.get("UnitPrice"));
			}
			if(oneLineItem.has("UnitPrice")) {
				oneLine.put("UnitPrice", oneLineItem.get("UnitPrice"));
			}
			if(oneLineItem.has("Quantity")) {
				oneLine.put("QuantityOrdered", oneLineItem.get("Quantity"));
			}
			if(oneLineItem.has("LineNumber")) {
				oneLine.put("LineNumber", oneLineItem.get("LineNumber"));
			}
			
			if(oneLineItem.has("B2BQuoteNumber")) {
				oneLine.put("B2BQuoteNumber", oneLineItem.get("B2BQuoteNumber"));
			}
			
			if(oneLineItem.has("FulfillmentsItems")) {
				oneLine.put("FulfillmentItemIds", oneLineItem.get("FulfillmentsItems"));
			}		
				
			JSONArray b2b_FulfillmentItems = b2b_LineItems.getJSONObject(i).getJSONArray("FulfillmentsItems");
			boolean orderwithFullfillmentPresent = false;
			for(int j=0;j<b2b_FulfillmentItems.length();j++) {
//				System.out.println("b2b_FulfillmentItems.getString(j) : " + b2b_FulfillmentItems.getString(j));
//
//				System.out.println("b2b_LineItems.getJSONObject(i).getString(\"LineNumber\") : " + b2b_LineItems.getJSONObject(i).getString("LineNumber"));
				
				if(itemid_orderNum.containsKey(b2b_FulfillmentItems.getString(j))) {
					orderInformation.put(itemid_orderNum.get(b2b_FulfillmentItems.getString(j)), new JSONObject("{\r\n" + 
							"            \"OrderNumber\": \""+itemid_orderNum.get(b2b_FulfillmentItems.getString(j))+"\"\r\n" + 
							"          }"));
					orderwithFullfillmentPresent = true;
				}
			}
			
			if(orderwithFullfillmentPresent) {
				oneLine.put("Orders", orderInformation);				
			}
			finalStructure.getJSONObject("_embedded").getJSONObject("lines").put((countLine++) + "", oneLine);
		}	
		
		if(B2B_data_Obj.has("DPID")) {
			finalStructure.put("DPID", B2B_data_Obj.get("DPID"));
		}
		if(B2B_data_Obj.has("PONumber")) {
			finalStructure.put("PurchaseOrderNumber", B2B_data_Obj.get("PONumber"));
		}
		if(B2B_data_Obj.has("PartnerCountry")) {
			finalStructure.put("PartnerCountry", B2B_data_Obj.get("PartnerCountry"));
		}
		if(B2B_data_Obj.has("Partner")) {
			finalStructure.put("Partner", B2B_data_Obj.get("Partner"));
		}
		
//		System.out.println("---------------------------------------------------------------");
		
//		System.out.println("finalStructure : " + finalStructure.toString());

		return finalStructure;
	}
	
	public void retrieveOrderAndhitANS(JSONObject B2B_data_Obj) {
		if(B2B_data_Obj.has("DPID") && (!B2B_data_Obj.isNull("DPID"))) {
			String DPID = B2B_data_Obj.getString("DPID");
			System.out.println(" --------------------------------------------------------------------------------------------- " + DPID);
			
			String hitGCMPServiceV2 = hitGCMPServiceV2(DPID);
//			System.out.println(hitGCMPServiceV2);
			Map<String, String> itemid_orderNum = generateItemOrderMapGCMP(hitGCMPServiceV2);
			if(itemid_orderNum == null) {
				System.out.println("GCMP not present");
				String hitOMCSService = hitOMCSService(DPID);
				if(hitOMCSService.contentEquals("Some Exception")) {
					System.out.println("OMCS not present");
				} else {
					itemid_orderNum = generateItemOrderMapOMCS(hitOMCSService);
//					System.out.println("itemid_orderNum ::::::::::::" + itemid_orderNum);
				}
				
//				System.out.println("-----------------------------------------------");
			}
			
			if(itemid_orderNum != null) {
				JSONObject lineMapData = generateLineMap(B2B_data_Obj, itemid_orderNum);
				System.out.println("lineMapData : " + lineMapData);
			}
			System.out.println("itemid_orderNum ::::::::" + itemid_orderNum);
			
//			System.out.println("----------------------------------------------");
			
			
		}
	}
	
	
